//import * as tfjs from '@tensorflow/tfjs'
var tfjs = require('@tensorflow/tfjs');
import React from 'react'

const Main = () => {
	this.model = tfjs.loadModel('./modelJS/model.json');
	console.log('model loaded');
}

export default Main;
